import React from 'react'
import { NavLink } from 'react-router-dom'
import logo from '../images/logo.jpeg'
import MenuIcon from '@material-ui/icons/Menu';
import Timer from './Timer';


const Navbar = () => {
    const MinSecs = { minutes: 10, seconds: 0 }
    return (
        <>
            <nav className="flex menu justify-between items-center h-16 bg-white text-black relative shadow-sm m">
                {/* logo */}
                <NavLink to="/"><img className="h-full logo" src={logo} alt="CODINGAL" /></NavLink>
                <NavLink  to="/">Trial lesson[Grade 1-3]</NavLink>
                  {/* hamburger button */}
                <div className="px-4 my-auto h-16 cursor-pointer md:hidden">
                    <MenuIcon  />
                </div>

                {/* manubar */}
                <div className="pr-8 md:block hidden">

                    <Timer className="p-4 " MinSecs={MinSecs} />
                    <button className="bg-red-500  hover:bg-red-700 text-white font-bold py-2 px-4 rounded">End Class</button>
                </div>
            </nav>

        </>
    )
}

export default Navbar
